__NUXT_JSONP__("/drugs/Anti-FGFR3_Antibody-drug_Conjugate_LY3076226", (function(a,b,c,d){return {data:[{drug:{slug:b,emaEpar:[],fdaDrugLabel:[],id:b,nciThesaurus:{casRegistry:a,chebiId:a,chemicalFormula:a,definition:"An antibody-drug conjugate (ADC) composed of a human monoclonal antibody against the fibroblast growth factor receptor type 3 (FGFR3) that is conjugated to an undisclosed cytotoxic agent, with potential antineoplastic activity. Upon administration, the antibody moiety of anti-FGFR3 ADC LY3076226 binds to FGFR3. Upon internalization, the cytotoxic moiety causes cell death in FGFR3-expressing tumor cells. FGFR3, a receptor tyrosine kinase upregulated or mutated in many tumor cell types, plays a key role in tumor cell proliferation.",fdaUniiCode:"GP2L3N7FIM",identifier:"C123829",preferredName:c,semanticType:"Pharmacologic Substance",subclassOf:["C129823","C1512","C164035"],synonyms:["ADC LY3076226","Anti-FGFR3 ADC LY3076226",c,"Anti-fibroblast Growth Factor Receptor 3 Antibody-Drug Conjugate LY3076226","LY-3076226","LY3076226"]},dir:"\u002Fdrugs",path:"\u002Fdrugs\u002FAnti-FGFR3_Antibody-drug_Conjugate_LY3076226",extension:".json",createdAt:d,updatedAt:d}}],fetch:{},mutations:void 0}}("","Anti-FGFR3_Antibody-drug_Conjugate_LY3076226","Anti-FGFR3 Antibody-drug Conjugate LY3076226","2021-10-30T13:30:08.623Z")));